INSERT INTO `agents` VALUES (22, 43, 1, '明创', '明创', 110000, 101, '瓷砖，又称磁砖，是以耐火的金属氧化物及半金属氧化物，经由研磨、混合、压制、施釉、烧结之过程，而形成的一种耐酸碱的瓷质或石质等，建筑或装饰材料，称之为瓷砖。其原材料多由粘土、石英砂等等混合而成。', '[\"images/20181205/20181205094510-5c072da688373.png\"]', 0, '2018-12-05 09:48:10', '2018-12-05 09:48:10', NULL);
