INSERT INTO `drawing_parts` VALUES (3, '明创科技', 43, '瓷砖，又称磁砖，是以耐火的金属氧化物及半金属氧化物，经由研磨、混合、压制、施釉、烧结之过程，而形成的一种耐酸碱的瓷质或石质等，建筑或装饰材料，称之为瓷砖。其原材料多由粘土、石英砂等等混合而成。', 110000, '朝阳区科技大厦', '[\"images/20181205/20181205095435-5c072fdb62c1e.png\", \"images/20181205/20181205095435-5c072fdb92bd8.png\", \"images/20181205/20181205095436-5c072fdc1ec0f.png\", \"images/20181205/20181205095436-5c072fdc5b7f5.png\", \"images/20181205/20181205095436-5c072fdc942b8.png\", \"images/20181205/20181205095436-5c072fdcbe47e.png\"]', 1543974876, 1543974876, 0);
