INSERT INTO `feedback` VALUES (2, 18, '相比在线客服，反馈表单形式固定化，方便归类整理分析反馈问题，研发成本低，大部分APP都采用这种。填写表单的设计要点：\n\n1、表单不要太长，字段尽量少，减少用户输入；\n\n2、不要让用户填写姓名、地址等信息；\n\n3、反馈之后要有回复，不要杳无音讯，回复不要太官话和机械，要有人情味，让用户觉得他的反馈是有用的；\n\n4、能查看反馈记录及回复结果，如APP中设置“我的反馈”、邮件回复结果；\n\n4、附带相关信息，如token、账号、地区、运营商类型、操作系统版本、APP版本等信息，以便更准确分析需求、定位缺陷；\n\n5、 归类整理，反馈较多的整理成常见问题。\n\n6、输入框过滤！@~#￥%……&amp;*等特殊字符，以防SQL注入，设置每天提交次数限制，以防提交垃圾数据。\n\n7、有些APP，意见反馈会放在主界面或初装二次启动时引导用户吐槽反馈，这些都是为了得到更有效的用户反馈，完善产品。\n\n作者：楚木风起\n链接：https://www.jianshu.com/p/c7f259f438fe\n33333333333333', 1542943905, '13593577056', 1542943905, 0);
