INSERT INTO `versions` VALUES (1, '瓷砖，又称磁砖，是以耐火的金属氧化物及半金属氧化物，经由研磨、混合、压制、施釉、烧结之过程，而形成的一种耐酸碱的瓷质或石质等，建筑或装饰材料，称之为瓷砖。其原材料多由粘土、石英砂等等混合而成。', '1.0', 'V1.1', '400-800-8000', '2018-11-24 11:27:46', '2018-11-24 11:27:56');
